export interface ICard {
  imgUrl: string;
  title: string;
  id: number;
}

const url = "https://i1.sndcdn.com/artworks-000635780677-yhmbpw-t500x500.jpg";

export const Cards: ICard[] = [
  { imgUrl: url, title: "Медицинский центр", id: 1 },
  { imgUrl: url, title: "Медицинский центр", id: 2 },
  { imgUrl: url, title: "Медицинский центр", id: 3 },
  { imgUrl: url, title: "Медицинский центр", id: 4 },
  { imgUrl: url, title: "Медицинский центр", id: 5 },
  { imgUrl: url, title: "Медицинский центр", id: 6 },
];
